import Link from "./Link.js";

class Header extends React.Compontent {
    render() {
        return <header className="App-header">
            <Link url="/" text="Home" class="header_link"/>
            <Link url="/reports" text="Reports" class="header_link"/>
            <Link url="/about" text="About" class="header_link"/>
        </header>
    }
}

export default Header;
